const Header = ({title}) => {
    return (
        <header classNa='header'>
            <h1>{title}</h1>
            <button className>Add</button>
        </header>
    )
}

Header.defaultProps = {
    title: 'Task Tracker'
}

Header.propTypes = {
    title: PropTypes.string.isRequired
}

